#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>



typedef struct node {
    char character;
    int counter;
    struct node* sub_nodes[26];
} Node;

typedef struct {
    Node *start;
} WordDictionary;

bool search(struct node* head, char* word);
bool cosearch(struct node* root, char *iter);

/** Initialize your data structure here. */
WordDictionary* wordDictionaryCreate() {
    WordDictionary* word = (WordDictionary*)malloc(sizeof(WordDictionary));
    word->start = (Node*)malloc(sizeof(Node));
    for(int i = 0; i < 26; i++) {
        word->start->sub_nodes[i] = NULL;
    }
    return word;
}

int hash(char c) {
    return c-'a';
}

/** Adds a word into the data structure. */
void wordDictionaryAddWord(WordDictionary* obj, char* word) {
    char *iter = word;
    struct node* head = obj->start;
    struct node* current = head;
    while(*iter != '\0') {
        int index = hash(*iter);
        if (!current->sub_nodes[index]) {
            struct node* newNode = (struct node*)malloc(sizeof(struct node));
            current->sub_nodes[index] = newNode;
            newNode->character = *iter;
            newNode->counter = 0;
            current = newNode;
            for(int i = 0; i < 26; i ++)
                newNode->sub_nodes[i] = NULL;
        }
        current = current->sub_nodes[index];
        iter ++;
    }
    current->counter += 1;

}

bool cosearch(struct node* root, char *iter) {
    if (*iter == '.') {
        for(int i = 0; i < 26; i ++) {
            if(root->sub_nodes[i]) {
                if (*(iter+1) == '\0') {
                    if(root->sub_nodes[i]->counter) {
                        return true;
                    }
                } else {
                    bool flag = cosearch(root->sub_nodes[i], iter+1);
                    if (flag)
                        return true;
                }
            }
        }
        return false;
    } else {
        return search(root, iter);
    }
}

bool search(struct node* head, char* word) {
    char *iter = word;
    struct node* current = head;
    while (*iter != '\0') {
        if (*iter == '.') {
            return cosearch(current, iter);
        } else {
            int index = hash(*iter);
            current = current->sub_nodes[index];
            if(!current)
                break;
        }
        iter ++;
    }
    if(*iter != '\0')
        return false;
    if(*iter == '\0' &&  current->counter > 0)
        return true;
    return false;
}

